import { ScrollView, StyleSheet, Text, View } from 'react-native';

import { CardSessionsReport } from '../components/Card/CardSessionsReport';
import { CardTherapyProgress } from '../components/Card/CardTherapyProgress';

import { HeroLight } from './../components/Hero/HeroLight';

const title = `Insights`;
const description = `You do not have any insights yet. Please complete atleast 10 therapy sessions to get insights..`;
const buttonText = `Life with Cala Trio`;
const link = `List`;

export const InsightsScreen = props => {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      <HeroLight
        title={title}
        description={description}
        buttonText={buttonText}
        link={link}
      />
      <View style={styles.content}>
        <CardSessionsReport />
        <CardTherapyProgress />
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    // display: 'flex',
    // flexDirection: 'column',
    // flex: 1,
    // justifyContent: 'space-around',
    width: '100%',
    //backgroundColor: Colors.WHITE,
    //backgroundColor: 'red',
  },
  content: {
    paddingHorizontal: 30,
    width: '100%',
    //backgroundColor: 'green',
  },
});
